const timeZone = [
    {
        city: lagos,
        zone: 'Africa/Lagos',
    },

    {
        city: newYork,
        zone: 'America/New_York',
    },

    {
        city: china,
        zone: 'Asia/Shanghai',
    },

    {
        city: paris,
        zone: 'Europe/Paris',
    },

    {
        city: pakistan,
        zone: 'Asia/Karachi',
    },
]

export default timeZone;
